import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

export default function SimpleTable() {
    const classes = useStyles();
    const [records, setRecords] = useState([]);

    function SetR() {
        axios("https://corona.lmao.ninja/v2/https://corona.lmao.ninja/countries?sort=deaths")
        .then((response)=>{
            const Timeline = response.data;
            setRecords(Timeline);
        })
        .catch((error)=>{
            console.log(error)
    });
    }

    function Display(record) {
        return(
            <TableRow key={record.country}>
              <TableCell component="th" scope="row">
                {record.Country}
              </TableCell>
              <TableCell align="right">{record.cases}</TableCell>
              <TableCell align="right">{record.deaths}</TableCell>
              <TableCell align="right">{record.recovered}</TableCell>
            </TableRow>
          );
    }


  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Country</TableCell>
            <TableCell align="right"></TableCell>
            <TableCell align="right">Cases&nbsp;</TableCell>
            <TableCell align="right">Deaths&nbsp;</TableCell>
            <TableCell align="right">Recoveries&nbsp;</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {records.map()}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
